  SWIG_Python_SetConstant(d, "gr_block_gw_message_type_ACTION_FORECAST",SWIG_From_int(static_cast< int >(gr_block_gw_message_type::ACTION_FORECAST)));
  SWIG_Python_SetConstant(d, "gr_block_gw_message_type_ACTION_START",SWIG_From_int(static_cast< int >(gr_block_gw_message_type::ACTION_START)));
